import React from 'react'
import GoogleMap from 'google-map-react'
import Marker from 'google-map-react'

import getLatLng from '../logic/Geocoding.js'

const mapAPIKey = "AIzaSyBlE7GymtUyLM97k2QlT1lPUJCYU_1GHd4" // TODO MOVE THIS TO SECRETS FILE
const ithacaLatLng = {lat: 42.4534, lng: -76.4735}
const mapZoom = 15

const markerComponent = ({ text }) => <div>{text}</div>

class MapView extends React.Component {
  render() {
    return (
        <div className="App" style={{width: 500}, {height: 500}}>
            <h1> Abode </h1>
            <GoogleMap bootstrapURLKeys={{ key: mapAPIKey }} defaultCenter={ithacaLatLng} defaultZoom={mapZoom}>
              <markerComponent lat={42.4534} lng={-76.4735} />
            </GoogleMap>
        </div>
    );
  }
}

export default MapView;
